import React from "react";
import { PresentationStyle, WelcomeStyle } from "../../styles/FrontPageStyle/FrontPage.style.ts";

function Presentation() {
  return (
    <PresentationStyle>
      <WelcomeStyle>

      <h1>Welcome</h1>
      </WelcomeStyle>
      <h2>I'm Ryad Laouedj</h2>
      <p>
        Creative developer & student at 42 Paris. Between Design & Code I try to
        create intuitive interfaces for user through a Logic & Organized based
        code.
      </p>
      <button>Let's begin</button>
    </PresentationStyle>
  );
}

export default Presentation;
